import React from 'react';
import {Col, Row, Card, Button} from 'react-bootstrap/';

// Det bruker skal se når de kommer inn på nettside når de er allerede logget it

const Dashboard = () => {
    return(
    
      <Row className = "bg-dark  mr-5 ml-5 " style={ {height:'100vh'}}> {/*Bootstrap deler siden opp i 12 kolonner, sier jeg vil bruke 9 til ene */}
        <Col> 
     
        </Col>
        <Col className = "col-4 mt-5">
        <Card className="text-center">
          <Card.Header>Featured</Card.Header>
          <Card.Body>
            <Card.Title>Special title treatment</Card.Title>
            <Card.Text>
              With supporting text below as a natural lead-in to additional content.
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
          <Card.Footer className="text-muted">2 days ago</Card.Footer>
        </Card>
        </Col>
      </Row>
    
    );
};
export default Dashboard;
